You ever find yourself in Vancouver and wanting a killer pizza hit up @pizzeriafarina near Thornton Park. After our sesh we hit them up and I swear it was a near perfect pizza.  But the real secret is ask for the hot honey chilli to drizzle on top.... crazy. Had to give them an official @snacksoflifepod shout out as some 🔥🔥🔥🔥

@pizzeriafarina thank you for the great pizza, I loved every bite 🙌

#Vancouver #VancouverPizza

Yesterday we celebrated Aleeya's 6th birthday, her actual birthday is on Monday but we wanted to throw a fun little party and man..... if I have any advice for new parents or people who wanna have kids regarding parties is to rent something the kids can all use and enjoy, our choice was a bouncy castle/slide and honestly, I've never been more jealous of these little kids then I am watching them rip down this water slide. 

Growing up with a March birthday the best I could hope for was no rain or snow so that my cousins could make it. And it was always like 90% cousins because when you grow up in an immigrant family, most times you have enough cousins that there's only room for like 2 friends from school. 

Shout-out Portuguese Bakerys in the 90s who cranked out these weird birthday cakes with almond shavings on the side and a yellow custard frosting on top. So fire but I've never once seen these cakes outside of Portuguese bakeries !! 

#AleeyaJayRita

